import React, { Component } from 'react'
import styled from 'styled-components'
const H = styled.h1`
  color: black;
  padding-top:calc(40px + 2vmin)
`;
class About extends Component {
  render() {
    return (
      <div>
        <H>About</H>
      </div>
    )
  }
}
export default About
